import { Grid } from "hero-design"
import { Image } from 'react-bootstrap';
import { useHistory } from "react-router-dom";

export default function Header() {
    const history = useHistory()

    return (
        <Grid.Row>
            <Grid.Col>
                <Image
                    src={'/augustus.png'}
                    roundedCircle
                    style={{
                        width: '100px',
                        height: '',
                        paddingLeft: '20px',
                        cursor: 'pointer'
                    }}
                    onClick={(e: any) => {
                        history.push('/dam')
                    }}
                ></Image>
            </Grid.Col>
        </Grid.Row>
    )
}
